
-- Anti-Dump + Anti-Debug Layer
do
    local t0 = os.clock()
    for _=1,3e5 do end
    if os.clock() - t0 < 0.01 then
        return
    end

    if debug and debug.getinfo then
        local info = debug.getinfo(1)
        if info and info.short_src and info.short_src ~= "=[C]" then
            return
        end
    end

    if getfenv and getfenv(0) then
        return
    end
end


